package com.example.android.bostontourguide;


import android.os.Bundle;
import android.support.v4.app.Fragment;
import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;
import android.widget.ListView;

import java.util.ArrayList;

/**
 * A simple {@link Fragment} subclass.
 */
public class ParksFragment extends Fragment {

    private View rootView;
    private ArrayList<Place> placeArrayList = new ArrayList<>();
    public static final String ARG_PAGE = "ARG_PAGE";
    private int mPage;

    public static ParksFragment newInstance(int page) {
        Bundle args = new Bundle();
        args.putInt(ARG_PAGE, page);
        ParksFragment fragment = new ParksFragment();
        fragment.setArguments(args);
        return fragment;
    }

    @Override
    public void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        mPage = getArguments().getInt(ARG_PAGE);
    }

    public ParksFragment() {
        // Required empty public constructor
    }

    @Override
    public View onCreateView(LayoutInflater inflater, ViewGroup container, Bundle savedInstanceState) {
        rootView = inflater.inflate(R.layout.places_list, container, false);

        setupListView();

        ListView listView = (ListView) rootView.findViewById(R.id.list);
        PlaceAdapter placeAdapter = new PlaceAdapter(getContext(), placeArrayList);
        listView.setAdapter(placeAdapter);

        return rootView;
    }

    private void setupListView() {
        placeArrayList.add(new Place("Freedom Trail", "See Boston's history", "data:image/jpeg;base64,"));
        placeArrayList.add(new Place("Boston Common", "Public park", "data:image/jpeg;base64,"));
        placeArrayList.add(new Place("Beacon Hill", "Walking area", "data:image/jpeg;base64,"));
        placeArrayList.add(new Place("Copley Square", "Public square", "data:image/jpeg;base64,"));
        placeArrayList.add(new Place("Boston Harbor", null, "data:image/jpeg;base64,"));
        placeArrayList.add(new Place("Mt. Auburn Cemetary", "Rural cemetary", "http://www.bostonatomy.com/wp-content/uploads/2015/07/20150506-Mount-Auburn-Cemetery-017.jpg"));
        placeArrayList.add(new Place("Arnold Arbetoretum", "Private park", "http://promptguides.com/boston/_photos/arnold_arboretum/arnold_arboretum_002.jpg"));
        placeArrayList.add(new Place("Blue Hills Reservation", "Hiking area", "data:image/jpeg;base64,"));
        placeArrayList.add(new Place("Cambridge Center Roof Garden", "Rooftop garden", "http://hollistonreporter.com/pix/articles/2013/10/Cambridge_Center_Roof_Garden_Fountain.jpg"));
        placeArrayList.add(new Place("Charles River Esplanade", "Walking path", "https://upload.wikimedia.org/wikipedia/commons/thumb/0/05/Charles_River_Esplanade_-_IMG_3777.jpg/1200px-Charles_River_Esplanade_-_IMG_3777.jpg"));
        placeArrayList.add(new Place("Bunker Hill Monument", "Memorial site", "https://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Bunker_hill_2009.JPG/250px-Bunker_hill_2009.JPG"));
    }
}
